import React, { Component } from 'react';
import ReactTable from "react-table";
import "react-table/react-table.css";
import './tableWidget.scss';
import OrderData from './OrderData.json';
import icon from './TruckIcon.png';

class DataTable extends Component {
  constructor(){
    super();
    this.state={

      OrderData:[],
      columns:[{
        Header: 'Date:',
        accessor: 'date'
      },{
        Header: 'Created By:',
        accessor: 'createdBy'
      },{
        Header: 'Account Number:',
        accessor: 'accountNum'
      },{
        Header: 'PO Number:',
        accessor: 'PO'
      },{
        Header: 'Order Number:',
        accessor: 'orderNum'
      },{
        Header: 'Order Status:',
        accessor: 'orderStatus'
      },
      {
        Header: 'Total:',
        accessor: 'total'
      },
    ],
    }
  }
    componentDidMount() {
      fetch('wwww.grandandtoy.com/DashboardAPI/OrderTracking')
      .then(response =>  console.log(response))
      .then(data => {
        console.log(data) 
      })
      .catch(error => console.error(error))
    }


  render() {
    return (
          <div>
              <div className="title">Order History <img className="icon" src={icon}></img> <span class="btn btn-primary">View</span></div>

              <ReactTable 
                data={OrderData}
                columns={this.state.columns}
                defaultPageSize = {10}
                style={{
                  height: "300px" 
                }}

              />

          </div>
    )

  }
}


export default DataTable;
